// Remove the attribute Style from the element.
func (e *SVGAnimateElement) StyleRemove(keys ...string) *SVGAnimateElement {
	if e.keyValueStrings == nil {
		return e
	}
	kv, ok := e.keyValueStrings.Get("style")
	if !ok {
		return e
	}
	kv.Remove(keys...)
	return e
}
